/**
 * Text alignment of a UILabel or UILatexLabel
 * Reference: https://docs.microsoft.com/en-us/dotnet/api/xamarin.forms.textalignment
 */
export class TextAlignment {
    /** @returns {TextAlignment} */ static get START(): TextAlignment;
    /** @returns {TextAlignment} */ static get CENTER(): TextAlignment;
    /** @returns {TextAlignment} */ static get END(): TextAlignment;
}
